import logo from '../image/logo.jpg'
import {Link} from "react-router-dom"
import './nav.css'

function Nav() {
  return (
      <div className='navbar'>
          <nav>
              <Link to="/" className="brand">
              <img src={logo} alt="" className="logo-img" />
              </Link>
              <Link to="/create">Create Recipes</Link>
      </nav>
      </div>
  )
}

export default Nav;
